var title_f38_41_39579="Criteria personality disorder";
var content_f38_41_39579=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F78113&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F78113&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    General diagnostic criteria for personality disorder",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       DSM-IV requires that the following be present in order to diagnose a personality disorder:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       A. An enduring pattern of inner experience and behavior that deviates markedly from the expectations of the individual's culture. This pattern is manifested in two (or more) of the following areas:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       1. Cognition (ie, ways of perceiving and interpreting self, other people, and events)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       2. Affectivity (ie, the range, intensity, lability, and appropriateness of emotional response)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       3. Interpersonal functioning",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       4. Impulse control",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       B. The enduring pattern is inflexible and pervasive across a broad range of personal and social situations.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       C. The enduring pattern leads to clinically significant distress or impairment in social, occupational, or other important areas of functioning.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       D. The pattern is stable and of long duration and its onset can be traced back at least to adolescence or early adulthood",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       E. The enduring pattern is not better accounted for as a manifestation or consequence of another mental disorder",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       F. The enduring pattern is not due to the direct physiological effects of a substance (eg, a drug of abuse, a medication) or a general medical condition (eg, head trauma)",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from American Psychiatric Association. Diagnostic and Statistical Manual of Mental Disorders, 4th ed, Text revision (DSM-IV-TR). American Psychiatric Association, Washington, DC, 2000.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
