var title_f38_41_39580="Carbon monoxide poisoning - Rapid overview";
var content_f38_41_39580=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F60672&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F60672&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Carbon monoxide poisoning: Rapid overview",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        <span style=\"color: #ff0000;\">",
"         To obtain emergent consultation with a medical toxicologist, call the United States Poison Control Network at 1-800-222-1222, or access the World Health Organization's list of international poison centers (",
"        </span>",
"        <a href=\"file://www.who.int/gho/phe/chemical_safety/poisons_centres/en/index.html\" target=\"_blank\">",
"         www.who.int/gho/phe/chemical_safety/poisons_centres/en/index.html",
"        </a>",
"        <span style=\"color: #ff0000;\">",
"         ).",
"        </span>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        History",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Duration and mechanism of exposure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Assess for major symptoms: loss of consciousness, confusion, symptoms consistent with hypoxia (ie, chest pain)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Assess for minor symptoms: headache, nausea/vomiting",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Assess pregnancy status",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Physical examination",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Careful evaluation of mental status",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Physical examination usually unremarkable",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Diagnostic evaluation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Check CO level with co-oximetry of arterial or venous blood",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Check acid-base status using (preferably arterial) blood gas",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Obtain ECG in all patients; measure cardiac biomarkers in patients &ge;65, patients with significant cardiac risk factors, and younger patients with chest pain or symptoms suggestive of ischemia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Consider CNS imaging (head CT) in patients with altered mental status to rule out other etiologies",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Measure blood cyanide concentration; consider empiric treatment for cyanide poisoning in patients with smoke inhalation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Treatment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Secure airway, breathing, and circulation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Intubate as clinically indicated",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Apply high-flow oxygen to",
"        <strong>",
"         ALL",
"        </strong>",
"        CO poisoned patients regardless of pulse oximetry or arterial pO2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Direct fire department to assess for environmental exposure and remove victims",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        We suggest hyperbaric oxygen (HBO) for:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        CO level &gt;25 percent (&gt;20 percent if pregnant)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Loss of consciousness",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Severe metabolic acidosis (pH &lt;7.1)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Concern for end-organ ischemia (chest pain, ECG changes, altered mental status)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     CNS: central nervous system; CO: carbon monoxide; CT: computed tomography; ECG: electrocardiogram; HBO: hyperbaric oxygen.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
